import axios from 'axios';

async function teamsUpdater() {
    let query = await axios({
        url: "http://140.112.174.222:1484/wind/fetch", 
        method: "post", 
        data: {
            mes: "123", 
        }, 
    });
    let data = query.data.result;
    data.sort((A, B) => (A.score > B.score) ? 1 : ((A.score < B.score) ? -1 : 0));

    var teams = new Array(data.length + 1).fill({});

    for (let i = 1; i <= data.length; i++) {
        teams[i] = {
            "rank": i, 
            "ID": data[i].ID, 
            "score": data[i].score, 
            "history": data[i].history, 
        };
    }

    teams.sort((A, B) => (A.rank > B.rank) ? 1 : ((A.rank < B.rank) ? -1 : 0));

    console.log(teams);

    return teams;
}

export default teamsUpdater;
